                        "product_description": "<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-bottom:16px; width:100%\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><img src=\"https://img.shopbase.com/files/internal/media/0x2200@16334338948d7ed93b6f.jpeg\" style=\"height:1000px; width:100%\" /></td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-left:auto; margin-right:auto; max-width:750px\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>There&#39;s something to be said about a top that&#39;s couch and Zoom-appropriate, and V-neck T-shirts shine in both categories. The comfortable, unassuming wardrobe essential shares all the same qualities of your favorite sweaters&mdash;a little loose yet still pulled together&mdash;and can easily take you from a virtual team check-in to a 30-minute stretch in your living room without having to change.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<table border=\"0\" cellpadding=\"0\" cellspacing=\"16px\" style=\"border-collapse:initial; display:grid; grid-gap:0; grid-template-columns:repeat(auto-fit, minmax(230px, 1fr)); line-height:18px; margin-left:-16px; margin-right:-16px\">\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\"><img src=\"https://img.shopbase.com/files/internal/media/0x540@1622690978d8f7be713a.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Moisture-wicking</strong>\r\n\t\t\t\t\t\t<p>This V-neck t shirt features a moisture-wicking tech stretch fabric that keeps you comfortable and dry</p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\"><img src=\"https://img.shopbase.com/files/internal/media/0x540@16226909770f7d279611.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Protect your skin</strong>\r\n\t\t\t\t\t\t<p>The neck seam is covered so raw edges can&rsquo;t chafe your skin</p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\"><img src=\"https://img.shopbase.com/files/internal/media/0x540@162269097581befca799.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Durable</strong>\r\n\t\t\t\t\t\t<p>It fiercely resists fading, pilling, wrinkles, staining and shrinkage</p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t</table>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-size:18px\"><strong>Product details:</strong></span>\r\n\t\t\t<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-bottom:1em; margin-top:0.75em\">\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><span style=\"font-size:12pt\"><span style=\"font-family:'Times New Roman'\"><img src=\"https://lh6.googleusercontent.com/scAxu0raT5ZbIt54AaTPQU597rITsamvstOvuMDOomUdRACHvK4_n6-kFGtsRbj9A0MYYLkGdJ99Pkxe3fgaOMQZqzh-NTT6dbFXGxzWEaJtpAUf7uD9WPHhR772aUCkuSri7R0d\" style=\"height:16px; width:16px\" /></span></span></td>\r\n\t\t\t\t\t\t<td>Material: 100% airlume combed and ringspun cotton</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><span style=\"font-size:12pt\"><span style=\"font-family:'Times New Roman'\"><img src=\"https://lh4.googleusercontent.com/1WtXfzY8FE7OlKug6KHjUPcc1wVGaUKJ_1jGGrt9JrycDAhpUyZV7XhTTJjP36tw3cy7LNXBILivGKr4BGBi_v3x_SyLqur5LXsWIS5eNO89-b0wVK312afWveSa2NQ7b3o1XaM_\" style=\"height:16px; width:16px\" /></span></span></td>\r\n\t\t\t\t\t\t<td>Do not tumble dry</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><span style=\"font-size:12pt\"><span style=\"font-family:'Times New Roman'\"><img src=\"https://lh5.googleusercontent.com/z_zxs19lOKzKFVZJ0DPgkmgqP5qzpg--lB5SKKD3EA2K-3AG8bAvK48MKrWF2zOtBQ5LtNU9aKqyhHp1ZBZBpTLClEUXTaumD08SLJR2yU9dx9evX4Jrm6FCRWl-DMHQ2diGqnCQ\" style=\"height:16px; width:16px\" /></span></span></td>\r\n\t\t\t\t\t\t<td>Do not bleach and iron</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><span style=\"font-size:12pt\"><span style=\"font-family:'Times New Roman'\"><img src=\"https://img.shopbase.com/files/internal/media/16226909691450f3376a.png\" style=\"height:16px; width:16px\" /></span></span></td>\r\n\t\t\t\t\t\t<td>Machine washable</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t</table>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Due to the different monitor and light effects, the actual color and size of the item may be slightly different from the visual image.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>",
