                        "title": "Classic Kids T-shirt",
                        "short_description": "<p>Please refer to this list of <a href=\"https://help.shopbase.com/en/article/list-of-restricted-ship-to-countriesregions-for-printhub-printbase-products-1jtnhuv/?bust=1620631969509\">Restricted Ship-to Countries/Regions</a></p>\r\n\r\n<p>The shipping fees will be shown in the checkout page.</p>\r\n\r\n<p>* The price list is for reference purposes only. Prices may vary according to size and color selected.</p>\r\n\r\n<p>* Two-sided printed shirts are available for $5 more each shirt.</p>",
                        "product_description": "<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-bottom:16px; width:100%\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><img src=\"https://img.shopbase.com/files/internal/media/0x2200@16292671017413d2889a.jpeg\" style=\"height:1000px; width:100%\" /></td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-left:auto; margin-right:auto; max-width:750px\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Building sandcastles, rolling on the grass, playing with paint, have you ever prevented your children from doing these things because you&rsquo;re worried about stubborn stains on their shirts? Let kids be kids because we have a T-shirt that is charming, comfortable, and, most importantly, easy to wash!</p>\r\n\r\n\t\t\t<p>Specially made for your tiny adventurers, this T-shirt will meet all your needs. Besides the skin-friendly material &ndash; perfect for the sensitive skin of children &ndash; it also lasts through cycles and cycles of wash without fading or tearing.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<table border=\"0\" cellpadding=\"0\" cellspacing=\"16px\" style=\"border-collapse:initial; display:grid; grid-gap:0; grid-template-columns:repeat(auto-fit, minmax(230px, 1fr)); line-height:18px; margin-left:-16px; margin-right:-16px\">\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\">\r\n\t\t\t\t\t\t<p><img src=\"https://img.shopbase.com/files/internal/media/0x540@16310996375efa76c342.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Well-made, high-quality</strong></p>\r\n\r\n\t\t\t\t\t\t<p>Never be worried about scratchy fabric that could irritate your child&rsquo;s skin. They&#39;ll feel comfy, fresh, and unrestricted all day long.</p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\">\r\n\t\t\t\t\t\t<p><img src=\"https://img.shopbase.com/files/internal/media/0x540@16292670962f9abdff1b.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Well-loved staple</strong></p>\r\n\r\n\t\t\t\t\t\t<p>Kids always seem in a hurry, hence a quick, easy shirt is the best thing to throw on. And, it pairs perfectly with anything.</p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\">\r\n\t\t\t\t\t\t<p><img src=\"https://img.shopbase.com/files/internal/media/0x540@1629267100102ae2a4d7.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Wash with ease</strong></p>\r\n\r\n\t\t\t\t\t\t<p>When kids are living their best lives, spills and stains are unavoidable. This T-Shirt however is super easy to wash and continues to look good as new.</p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t</table>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-size:18px\"><strong>Product details:</strong></span>\r\n\t\t\t<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-bottom:1em; margin-top:0.75em\">\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><span style=\"font-size:12pt\"><span style=\"font-family:'Times New Roman'\"><img src=\"https://img.shopbase.com/files/internal/media/162194020186ea7b7b4d.png\" style=\"height:16px; width:16px\" /></span></span></td>\r\n\t\t\t\t\t\t<td>Material: 100% Pre-shrunk Cotton, or Composition (96% cotton, 4% spandex)</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><img alt=\"\" src=\"https://img.shopbase.com/files/internal/media/162694371237cb0ef091.png\" style=\"height:16px; width:16px\" /></td>\r\n\t\t\t\t\t\t<td>Tumble dry</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><img alt=\"\" src=\"https://img.shopbase.com/files/internal/media/1621940201b963b8aab1.png\" style=\"height:16px; width:16px\" /></td>\r\n\t\t\t\t\t\t<td>Do not bleach</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><img alt=\"\" src=\"https://img.shopbase.com/files/internal/media/162322759296c5be9964.png\" style=\"height:16px; width:16px\" /></td>\r\n\t\t\t\t\t\t<td>Machine washable</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t</table>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p><strong>Note</strong></p>\r\n\r\n\t\t\t<ul>\r\n\t\t\t\t<li>Our products will be automatically fulfilled with pre-existing materials to optimize production and delivery time to customers.</li>\r\n\t\t\t</ul>\r\n\r\n\t\t\t<p><strong>Disclaimer</strong></p>\r\n\r\n\t\t\t<ul>\r\n\t\t\t\t<li>Due to variations of light and color settings of computer/personal device screens, colors may appear slightly different from photographic images.</li>\r\n\t\t\t\t<li>Due to the manufacturing process, sizes of items listed in descriptions are approximate and actual size may vary slightly.</li>\r\n\t\t\t\t<li>Due to the manufacturing process, alignment of images may vary slightly.</li>\r\n\t\t\t</ul>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>",
