                        "short_description": "<p>Please refer to this list of <a href=\"https://help.shopbase.com/en/article/list-of-restricted-ship-to-countriesregions-for-printhub-printbase-products-1jtnhuv/?bust=1620631969509\">Restricted Ship-to Countries/Regions</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n\t<li><strong>Australia:&nbsp;increase by $2</strong></li>\r\n\t<li><strong>Canada: increase by $2</strong></li>\r\n</ul>\r\n\r\n<div>The shipping fees will be shown in the checkout page.</div>\r\n\r\n<div>\r\n<div>&nbsp;</div>\r\n</div>\r\n\r\n<p>* The price list is for reference purposes only. Prices may vary according to size and color selected.</p>\r\n\r\n<p>* Two-sided printed shirts are available for $5 more each shirt.</p>",
                        "product_description": "<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-bottom:16px; width:100%\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><img src=\"https://img.shopbase.com/files/internal/media/0x2200@1633434372b910447e21.jpeg\" style=\"height:1000px; width:100%\" /></td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-left:auto; margin-right:auto; max-width:750px\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Remember, the best t-shirt is ultimately whatever feels right for you&ndash;not what you see in a magazine or what someone tells you is the best. Only put on t-shirts that can make you look stylish, go from day to night, and be worn from the city to a mountain.</p>\r\n\r\n\t\t\t<p>If you&rsquo;re looking for a t-shirt like that, look no further as it&rsquo;s already here!</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<table border=\"0\" cellpadding=\"0\" cellspacing=\"16px\" style=\"border-collapse:initial; display:grid; grid-gap:0; grid-template-columns:repeat(auto-fit, minmax(230px, 1fr)); line-height:18px; margin-left:-16px; margin-right:-16px\">\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\"><img src=\"https://img.shopbase.com/files/internal/media/0x360@1623323307a83163db3a.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Premium Fabric</strong>\r\n\t\t\t\t\t\t<p>It is made of 100% pre-shrunk cotton which makes it ultra breathable and super lightweight.</p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\"><img src=\"https://img.shopbase.com/files/internal/media/0x360@16233234131d3bd01bd9.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Round Neckline</strong>\r\n\t\t\t\t\t\t<p><span style=\"font-size:11pt\"><span style=\"font-family:Cambria,serif\">This tee offers a classic round neckline without being too high. Perfect to show off your clavicle.</span></span></p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top\"><img src=\"https://img.shopbase.com/files/internal/media/0x360@1623323454e55f18fa8f.jpeg\" style=\"margin-bottom:0.75em; vertical-align:top; width:100%\" /><strong>Different occasions</strong>\r\n\t\t\t\t\t\t<p>Suitable for daily wear and any occasions, such as work, dating, travel, and so on. It can be paired with jeans, leggings or a skirt.</p>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t</table>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><span style=\"font-size:18px\"><strong>Product details:</strong></span>\r\n\t\t\t<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-bottom:1em; margin-top:0.75em\">\r\n\t\t\t\t<tbody>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td style=\"vertical-align:top; width:20px\"><span style=\"font-size:12pt\"><span style=\"font-family:'Times New Roman'\"><img src=\"https://img.shopbase.com/files/internal/media/162194020186ea7b7b4d.png\" style=\"height:16px; width:16px\" /></span></span></td>\r\n\t\t\t\t\t\t<td>Material: 100% pre-shrunk cotton, or composition (96% cotton, 4% spandex)</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</tbody>\r\n\t\t\t</table>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Due to the different monitor and light effects, the actual color and size of the item may be slightly different from the visual image.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>",
