                        "short_description": "<p>Due to the COVID-19 and some geographical factors, there are restrictions on shipping in some countries/regions. Please refer to this list of <a href=\"https://help.shopbase.com/en/article/list-of-restricted-ship-to-countriesregions-for-printhub-printbase-products-1jtnhuv/?bust=1620631969509\">Restricted Ship-to Countries/Regions</a></p>\r\n\r\n<ul>\r\n\t<li><strong>Australia:&nbsp;increase by $1</strong></li>\r\n\t<li><strong>Canada: increase by $5</strong></li>\r\n</ul>\r\n\r\n<p>The shipping fees will be shown in the checkout page.</p>",
